import { AppBar, Toolbar, Box, Button, Stack } from '@mui/material';

export default function MyToolbar({ backgroundColor }) {
    const colorHex = backgroundColor;
    return (
        <>
            <Box sx={{ flexGrow: 1, }}>
                <AppBar elevation={0} position="static">
                    <Toolbar sx={{ padding: 1, backgroundColor: colorHex }}>
                        <Button
                            sx={{
                                fontSize: 30,
                                fontWeight: 'bold',
                                textTransform: 'none',
                                color: 'black'
                            }}>
                            Karyna Yen //</Button>

                        <Stack direction="row" spacing={2} sx={{ color: 'white', }}>
                            <Button>Projects</Button>
                            <Button>Other</Button>
                            <Button>ContactMe</Button>
                        </Stack>


                    </Toolbar>
                </AppBar>
            </Box>
        </>
    );
}
